import{_ as e,c as a,o,a as t}from"./app.201db6a0.js";const r="/phpstorm/assets/phpstorm-vagrant-add-box.7964bfd4.png",f=JSON.parse('{"title":"Vagrant","description":"","frontmatter":{},"headers":[{"level":2,"title":"\u5148\u51B3\u6761\u4EF6","slug":"\u5148\u51B3\u6761\u4EF6","link":"#\u5148\u51B3\u6761\u4EF6","children":[]},{"level":2,"title":"\u521D\u59CB\u5316 Vagrant \u6587\u4EF6","slug":"\u521D\u59CB\u5316-vagrant-\u6587\u4EF6","link":"#\u521D\u59CB\u5316-vagrant-\u6587\u4EF6","children":[]},{"level":2,"title":"\u6307\u5B9A\u865A\u62DF\u955C\u50CF","slug":"\u6307\u5B9A\u865A\u62DF\u955C\u50CF","link":"#\u6307\u5B9A\u865A\u62DF\u955C\u50CF","children":[]},{"level":2,"title":"\u542F\u52A8\u5B9E\u4F8B","slug":"\u542F\u52A8\u5B9E\u4F8B","link":"#\u542F\u52A8\u5B9E\u4F8B","children":[]},{"level":2,"title":"\u4E00\u4E9B\u547D\u4EE4","slug":"\u4E00\u4E9B\u547D\u4EE4","link":"#\u4E00\u4E9B\u547D\u4EE4","children":[]}],"relativePath":"guide/vagrant.md","lastUpdated":1662891734000}'),d={name:"guide/vagrant.md"},c=t('<h1 id="vagrant" tabindex="-1">Vagrant <a class="header-anchor" href="#vagrant" aria-hidden="true">#</a></h1><p><a href="http://vagrantup.com/" target="_blank" rel="noreferrer">Vagrant</a> \u662F\u4E00\u4E2A\u547D\u4EE4\u884C\u5B9E\u7528\u7A0B\u5E8F\uFF0C\u7528\u4E8E\u7BA1\u7406\u865A\u62DF\u673A\u7684\u751F\u547D\u5468\u671F\u3002</p><p>PhpStorm \u63D0\u4F9B\u4E0E Vagrant \u7684\u5B8C\u5168\u96C6\u6210\uFF0C\u5141\u8BB8\u914D\u7F6E Vagrant \u865A\u62DF\u73AF\u5883\uFF0C\u63A7\u5236\u865A\u62DF\u673A\u7684\u884C\u4E3A\uFF0C\u5E76\u5728\u9879\u76EE\u4E2D\u6267\u884C Vagrant \u547D\u4EE4\u3002</p><p>\u5728\u4F7F\u7528 Vagrant \u7684\u60C5\u51B5\u4E0B\uFF0C\u5C06\u6EE1\u8DB3\u4EE5\u4E0B\u5B9A\u4E49\uFF1A</p><ul><li><code>Vagrantfile</code>\uFF1A\u5B9A\u4E49 Vagrant \u73AF\u5883\u7684\u4E3B\u8981\u914D\u7F6E\u6587\u4EF6\uFF0C\u5B58\u50A8\u865A\u62DF\u955C\u50CF\u7684\u6240\u6709\u914D\u7F6E\uFF0C\u5E76\u544A\u8BC9 Vagrant \u5982\u4F55\u4F7F\u7528\u865A\u62DF\u673A\u3002</li><li><code>Virtual box</code>\uFF1A\u5305\u542B\u9884\u914D\u7F6E\u865A\u62DF\u673A\u7684\u865A\u62DF\u6C99\u7BB1\u3002 Vagrant \u4E0E\u4E0D\u540C\u7684\u865A\u62DF\u76D2\u5B50\u4F9B\u5E94\u5546\u5408\u4F5C\uFF0C\u4F8B\u5982 Oracle \u7684 VirtualBox\u3001VMWare \u6216 AWS\u3002</li><li><code>Instance</code>: \u865A\u62DF\u673A</li></ul><h2 id="\u5148\u51B3\u6761\u4EF6" tabindex="-1">\u5148\u51B3\u6761\u4EF6 <a class="header-anchor" href="#\u5148\u51B3\u6761\u4EF6" aria-hidden="true">#</a></h2><ul><li>\u4ECE <a href="https://plugins.jetbrains.com/plugin/7379-vagrant" target="_blank" rel="noreferrer">JetBrains repository</a> \u4E0B\u8F7D\u5E76\u5F00\u542F <code>Vagrant</code> \u63D2\u4EF6</li><li>\u5B89\u88C5 <a href="http://www.vagrantup.com/" target="_blank" rel="noreferrer">Vagrant</a> \u548C <a href="https://www.virtualbox.org/" target="_blank" rel="noreferrer">Oracle \u7684 VirtualBox</a> \u5E94\u7528\u7A0B\u5E8F\uFF0C\u5E76\u5206\u522B\u542F\u52A8\u4ED6\u4EEC\u3002</li></ul><h2 id="\u521D\u59CB\u5316-vagrant-\u6587\u4EF6" tabindex="-1">\u521D\u59CB\u5316 Vagrant \u6587\u4EF6 <a class="header-anchor" href="#\u521D\u59CB\u5316-vagrant-\u6587\u4EF6" aria-hidden="true">#</a></h2><p>\u8981\u5F00\u59CB\u4F7F\u7528 Vagrant\uFF0C\u9700\u8981\u521D\u59CB\u5316 <code>Vagrantfile</code>\uFF0C\u4ECE\u4E0B\u9762\u7684\u65B9\u5F0F\u4E4B\u4E00\u5373\u53EF\uFF1A</p><ul><li><p>\u6253\u5F00\u7EC8\u7AEF\uFF08<code>\u2325 + F12</code>\uFF09\u5E76\u8FD0\u884C\u4EE5\u4E0B\u547D\u4EE4\uFF1A<code>vagrant init</code></p><blockquote><p>\u8FD9\u5C06\u521D\u59CB\u5316 <code>Vagrantfile</code> \u5E76\u9ED8\u8BA4\u5C06\u5176\u653E\u5165\u9879\u76EE\u6839\u6587\u4EF6\u5939\u4E2D\u3002</p></blockquote></li><li><p>\u4F7F\u7528\u5FEB\u6377\u952E <code>Command + Shift + X</code> \u5C06\u521B\u5EFA\u521D\u59CB\u5316\u6587\u4EF6\u547D\u4EE4\u8F93\u5165 <code>vagrant init</code> \u8F93\u5165\u5373\u53EF\u3002</p></li></ul><p>\u6253\u5F00\u751F\u6210\u7684 <code>Vagrantfile</code> \u6587\u4EF6\uFF0C\u4F1A\u770B\u5230\u5DF2\u7ECF\u6709\u4E00\u4E2A\u9884\u5B9A\u4E49\u7684\u914D\u7F6E\u3002</p><p><code>config.vm.box = &quot;base&quot;</code> \u884C\u6307\u5B9A\u5C06\u5728\u9879\u76EE\u4E2D\u4F7F\u7528\u7684\u865A\u62DF\u6846\u3002</p><h2 id="\u6307\u5B9A\u865A\u62DF\u955C\u50CF" tabindex="-1">\u6307\u5B9A\u865A\u62DF\u955C\u50CF <a class="header-anchor" href="#\u6307\u5B9A\u865A\u62DF\u955C\u50CF" aria-hidden="true">#</a></h2><p>\u4F8B\u5982\uFF0C\u6307\u5B9A <code>ubuntu/trusty64</code> \u955C\u50CF\u3002</p><p>\u5B83\u5305\u542B\u4E00\u4E2A\u57FA\u672C\u7684 Ubuntu \u865A\u62DF\u673A\uFF0C\u4E5F\u53EF\u4EE5\u6839\u636E\u9700\u8981\u6307\u5B9A\u4EFB\u4F55\u5176\u4ED6\u865A\u62DF\u6846\u3002</p><p>\u8981\u67E5\u627E\u53EF\u7528\u865A\u62DF\u76D2\u5B50\u7684\u5217\u8868\uFF0C\u8BF7\u53C2\u9605 <a href="https://www.vagrantup.com/vagrant-cloud/boxes/catalog" target="_blank" rel="noreferrer">Vagrant Boxes</a>\u3002</p><p>\u6267\u884C\u4EE5\u4E0B\u64CD\u4F5C\u4E4B\u4E00\uFF1A</p><ul><li><p>\u6253\u5F00 Vagrantfile \u5E76\u5C06 <code>config.vm.box = &quot;base&quot;</code> \u884C\u66F4\u6539\u4E3A\u4EE5\u4E0B\u5185\u5BB9\uFF1A<code>config.vm.box = &quot;ubuntu/trusty64&quot;</code></p></li><li><p>\u5728 \u8BBE\u7F6E/\u9996\u9009\u9879 \u5BF9\u8BDD\u6846 (<code>\u2318 + ,</code>) \u4E2D\uFF0C\u9009\u62E9 <code>Tools</code> -&gt; <code>Vagrant</code>\u3002\u5728 Boxes \u7A97\u53E3\u4E2D\u5355\u51FB\u6309\u94AE\u5E76\u6307\u5B9A\u4EE5\u4E0B\u5185\u5BB9\uFF1A</p><ul><li><p><strong>Box name:</strong> <code>ubuntu/trusty64</code></p></li><li><p><strong>Box URL:</strong> <code>https://app.vagrantup.com/ubuntu/boxes/trusty64</code></p></li></ul><p><img src="'+r+'" alt=""></p></li></ul><p>\u4E00\u65E6 Vagrantfile \u521D\u59CB\u5316\u5B8C\u6210\u5E76\u6307\u5B9A\u4E86\u865A\u62DF\u6846\uFF0C\u5C31\u53EF\u4EE5\u90E8\u7F72\u548C\u8FD0\u884C\u865A\u62DF\u673A\u4E86\u3002</p><h2 id="\u542F\u52A8\u5B9E\u4F8B" tabindex="-1">\u542F\u52A8\u5B9E\u4F8B <a class="header-anchor" href="#\u542F\u52A8\u5B9E\u4F8B" aria-hidden="true">#</a></h2><p>\u6267\u884C\u4EE5\u4E0B\u64CD\u4F5C\u4E4B\u4E00\uFF1A</p><ul><li>\u6253\u5F00\u7EC8\u7AEF\uFF08<code>Alt + F12</code>\uFF09\u5E76\u8FD0\u884C\u4EE5\u4E0B\u547D\u4EE4\uFF1A<code>vagrant up</code></li><li>\u4F7F\u7528\u5FEB\u6377\u952E <code>Command + Shift + X</code> \u540E\u8F93\u5165 <code>vagrant up</code></li><li>\u4ECE\u4E3B\u83DC\u5355\u4E2D\uFF0C\u9009\u62E9 <code>Tools</code> -&gt; <code>Vagrant</code> -&gt; <code>Up</code></li></ul><div class="tip custom-block"><p class="custom-block-title">\u901A\u8FC7 SSH \u8FDE\u63A5\u5230\u6B63\u5728\u8FD0\u884C\u7684\u673A\u5668</p><p>\u542F\u52A8\u865A\u62DF\u673A\u540E\uFF0C\u5B83\u4FDD\u6301\u5728\u540E\u7AEF\u8FD0\u884C\u3002</p><p>\u8981\u901A\u8FC7 SSH \u8FDE\u63A5\u5230\u6B63\u5728\u8FD0\u884C\u7684\u673A\u5668\uFF1A \u6253\u5F00\u7EC8\u7AEF\uFF08<code>Alt + F12</code>\uFF09\u5E76\u8FD0\u884C\u547D\u4EE4\uFF1A<code>vagrant ssh</code></p></div><h2 id="\u4E00\u4E9B\u547D\u4EE4" tabindex="-1">\u4E00\u4E9B\u547D\u4EE4 <a class="header-anchor" href="#\u4E00\u4E9B\u547D\u4EE4" aria-hidden="true">#</a></h2><p>\u8981\u63A7\u5236\u5B9E\u4F8B\uFF0C\u8BF7\u4F7F\u7528 Vagrant \u547D\u4EE4\u3002\u5B83\u4EEC\u53EF\u4EE5\u4ECE\u7EC8\u7AEF <code>Alt + F12</code> \u6216\u4E3B\u83DC\u5355 <code>Tools</code> -&gt; <code>Vagrant</code> \u540E\u9009\u62E9\u5BF9\u5E94\u547D\u4EE4\u8FD0\u884C\u3002</p><p>\u4E0B\u9762\u4EC5\u5C55\u793A\u4E86\u4F7F\u7528\u865A\u62DF\u673A\u7684\u6700\u91CD\u8981\u7684\u547D\u4EE4\u3002Vagrant \u547D\u4EE4\u7684\u5B8C\u6574\u5217\u8868\uFF0C<a href="https://www.vagrantup.com/docs/cli" target="_blank" rel="noreferrer">\u53C2\u9605\u547D\u4EE4\u884C\u754C\u9762</a>\u3002</p><ul><li><p><code>Suspend</code> \u6302\u8D77\uFF1A\u6302\u8D77\u5B9E\u4F8B\u4F1A\u6682\u505C\u6240\u6709\u8FDB\u7A0B\u5E76\u4FDD\u5B58\u865A\u62DF\u673A\u7684\u5F53\u524D\u72B6\u6001</p><p>\u5728\u7EC8\u7AEF\u4E2D\u8FD0\u884C <code>vagrant suspend</code> \u6216\u5728\u4E3B\u83DC\u5355\u4E2D\u9009\u62E9 <code>Tools</code> -&gt; <code>vagrant</code> -&gt; <code>Suspend</code></p></li><li><p><code>Resume</code> \u6062\u590D\uFF1A\u6062\u590D\u4E00\u4E2A\u5B9E\u4F8B\u4F1A\u542F\u52A8\u4E00\u4E2A\u5148\u524D\u6302\u8D77\u7684\u865A\u62DF\u673A \u5728\u7EC8\u7AEF\u4E2D\u8FD0\u884C <code>vagrant resume</code> \u6216\u5728\u4E3B\u83DC\u5355\u4E2D\u9009\u62E9 <code>Tools</code> -&gt; <code>vagrant</code> -&gt; <code>Resume</code></p></li><li><p><code>Reload</code> \u91CD\u65B0\u52A0\u8F7D\uFF1A\u5F53\u4FEE\u6539\u4E86 Vagrantfile \u8FDB\u884C\u66F4\u6539\u5E76\u9700\u8981\u91CD\u65B0\u52A0\u8F7D\u5F53\u524D\u865A\u62DF\u73AF\u5883\u53CA\u5176\u914D\u7F6E\u65F6\uFF0C\u9700\u8981\u91CD\u65B0\u52A0\u8F7D\u5B9E\u4F8B\u3002 \u5728\u7EC8\u7AEF\u4E2D\u8FD0\u884C <code>vagrant reload</code> \u6216\u5728\u4E3B\u83DC\u5355\u4E2D\u9009\u62E9 <code>Tools</code> -&gt; <code>vagrant</code> -&gt; <code>Reload</code></p></li><li><p><code>Halt</code> \u5173\u95ED\uFF1A\u5173\u95ED\u5B9E\u4F8B\u4F1A\u505C\u6B62\u6B63\u5728\u8FD0\u884C\u7684\u865A\u62DF\u673A \u5728\u7EC8\u7AEF\u4E2D\u8FD0\u884C <code>vagrant halt</code> \u6216\u5728\u4E3B\u83DC\u5355\u4E2D\u9009\u62E9 <code>Tools</code> -&gt; <code>vagrant</code> -&gt; <code>Halt</code></p></li><li><p><code>Destroy</code> \u9500\u6BC1\uFF1A\u5F53\u9700\u8981\u5220\u9664\u4E0E\u5148\u524D\u521B\u5EFA\u7684\u73AF\u5883\u76F8\u5173\u7684\u6240\u6709\u5185\u5BB9\u65F6\uFF0C\u9500\u6BC1\u865A\u62DF\u673A\u5F88\u91CD\u8981\u3002\u5728\u521B\u5EFA\u5B9E\u4F8B\u671F\u95F4\u63D0\u4F9B\u7684\u6240\u6709\u8D44\u6E90\u90FD\u5C06\u88AB\u5220\u9664 \u5728\u7EC8\u7AEF\u4E2D\u8FD0\u884C <code>vagrant destroy</code> \u6216\u5728\u4E3B\u83DC\u5355\u4E2D\u9009\u62E9 <code>Tools</code> -&gt; <code>vagrant</code> -&gt; <code>Destroy</code></p></li></ul>',27),l=[c];function n(i,p,g,s,u,h){return o(),a("div",null,l)}const V=e(d,[["render",n]]);export{f as __pageData,V as default};
